public static class FileSanitiser
{
    public static string purifyStringForDisplay(string data)
    {
        data = data.Replace(|##QOT##||##BS##|t|##QOT##|, |##QOT##|    |##QOT##|).Replace(|##QOT##||##BS##||##QOT##||##QOT##|, |##QOT##||##BS##||##QOT##||##QOT##|).Replace(|##QOT##||##BS##||##QOT##||##QOT##|, |##QOT##||##BS##||##QOT##||##QOT##|);
        for (int i = 0; i LTHAN data.Length; i++) {
            if ((data|##LSB##|i|##RSB##| LTHAN 0x0020 || data|##LSB##|i|##RSB##| |##RAB##| 0x007F) AND (
                data|##LSB##|i|##RSB##| != 0x000A AND //Allow newlines
                data|##LSB##|i|##RSB##| != 0x000B AND
                data|##LSB##|i|##RSB##| != 0x000C AND
                data|##LSB##|i|##RSB##| != |##SIQ##||##BS##|n|##SIQ##|   )){
                //Este carácter no es un carácter Unicode latino.
                //We wont be able to display it
                //replace whatever|##SIQ##|s there with a space...
                data = data.Replace(data|##LSB##|i|##RSB##|, |##SIQ##| |##SIQ##|);

            }
        }
        return data;
    }

    public static void purifyVehicleFile(string path)
    {
        string data = Utils.readEntireFile(path);
        data = data.Replace(|##SIQ##||##BS##|t|##SIQ##|, |##SIQ##|#|##SIQ##|);
        data = data.Replace(|##QOT##||##BS##|r|##QOT##|, |##QOT##||##QOT##|);
        for (int i = 0; i LTHAN data.Length; i++) {
            if (!GuiData.font.Characters.Contains(data|##LSB##|i|##RSB##|) AND data|##LSB##|i|##RSB##| != |##SIQ##||##BS##|n|##SIQ##|) {
                data = replaceChar(data, i, |##SIQ##|_|##SIQ##|);
            }
        }

        Utils.writeToFile(data, |##QOT##|SanitisedFile.txt|##QOT##|);
    }

    public static string replaceChar(string data, int index, char replacer)
    {
        return data.Substring(0, index - 1) + replacer + data.Substring(index + 1, data.Length - index - 2);
    }

    public static void purifyNameFile(string path)
    {
        string data = Utils.readEntireFile(path);
        string|##LSB##||##RSB##| split = data.Split(Utils.newlineDelim);
        string|##LSB##||##RSB##| d;
        string ret = |##QOT##||##QOT##|;
        for(int i = 0; i LTHAN split.Length;i++) {
            d = split|##LSB##|i|##RSB##|.Split(Utils.spaceDelim, StringSplitOptions.RemoveEmptyEntries);
            ret += d|##LSB##|0|##RSB##| + |##QOT##||##BS##|n|##QOT##|;
        }

        Utils.writeToFile(ret, |##QOT##|SanitisedNameFile.txt|##QOT##|);
    }

    public static void purifyLocationFile(string path)
    {
        string data = Utils.readEntireFile(path);
        char|##LSB##||##RSB##| delims = {|##SIQ##||##BS##|t|##SIQ##| };
        string|##LSB##||##RSB##| split = data.Split(Utils.newlineDelim);
        string|##LSB##||##RSB##| d;
        string ret = |##QOT##||##QOT##|;
        for (int i = 1; i LTHAN split.Length; i++) {
            d = split|##LSB##|i|##RSB##|.Split(delims, StringSplitOptions.RemoveEmptyEntries);
            for (int j = 1; j LTHAN d.Length; j++) {
                ret += d|##LSB##|j|##RSB##|.Trim() + |##QOT##|#|##QOT##|;
            }
            ret += |##QOT##||##BS##|n|##QOT##|;
        }

        Utils.writeToFile(ret, |##QOT##|SanitisedLocFile.txt|##QOT##|);
    }

}
